webpackJsonp([0x9525817dc0f5],{365:function(e,t){e.exports={data:{post:{html:'<h1 id="gestion-associative"><a href="#gestion-associative" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Gestion associative</h1>\n<p>Le module de gestion associative vous permet de gérer vos adhérents de manière simple et intuitive.</p>\n<p>Jeyser CRM vous permet de gérer efficacement vos membres. Ils sont tous disponibles dès la page d\'accueil du module de gestion associative avec leurs coordonnées. Pour plus de détail, vous pouvez consulter la fiche de chaque membre.</p>\n<p>Sur cette fiche détaillée vous accèdez à ses coordonnées, ses informations adhérent, les compétences maitrisées, l\'historique des missions réalisées et même (dans le cas des membres de votre staff), à l\'historique des postes occupés et à ses permissions utilisateurs sur le CRM.</p>\n<br>\n\n  <a class="gatsby-resp-image-link" href="/static/fiche_membre-3ed505a52840ba025c7a2b84d1184d32-543a3.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 56.33116883116883%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="fiche membre" title="" src="/static/fiche_membre-3ed505a52840ba025c7a2b84d1184d32-10273.png" srcset="/static/fiche_membre-3ed505a52840ba025c7a2b84d1184d32-9b14a.png 163w,\n/static/fiche_membre-3ed505a52840ba025c7a2b84d1184d32-94962.png 325w,\n/static/fiche_membre-3ed505a52840ba025c7a2b84d1184d32-10273.png 650w,\n/static/fiche_membre-3ed505a52840ba025c7a2b84d1184d32-2fc6f.png 975w,\n/static/fiche_membre-3ed505a52840ba025c7a2b84d1184d32-543a3.png 1232w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<br>\n<p>Depuis cette fiche, via l\'onglet Documents, vous pouvez aussi générer une fiche récapitulative d\'adhésion, une convention étudiante et un accord de confidentialité (sous réserve que les documents types respectifs soient présent dans Jeyser). </p>\n<p>Pour plus de simplicité, Jeyser propose une liste rapide de tous les membres ayant déjà effectué des missions pour votre Junior-Entreprise. Plus de problèmes pour vérifier le dossier de vos membres avant l\'audit.</p>\n<br>\n\n  <a class="gatsby-resp-image-link" href="/static/liste_intervenants-68eefa79eb1994b59f4523a4639a76d1-6cdbf.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 19.036869826937547%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAAECAIAAAABPYjBAAAACXBIWXMAAAsSAAALEgHS3X78AAAAiElEQVQI152N4QrCMAyE+/6vs3fYb384cCgOGTho67rpmmZNWj18AvE4Qi58XIydVxeeG8sfNutXRMTM798EstQKG0qJeV/xm/dIiWJEl6qOfgREFPfHJbtOXpOILKcuHg+b9yJA1NRaVYtogbIoCCw4hhQwc87DMvRzb8kitve2uTZndwOP+AGgV+Z5hXZRMAAAAABJRU5ErkJggg==&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Liste intervenants" title="" src="/static/liste_intervenants-68eefa79eb1994b59f4523a4639a76d1-10273.png" srcset="/static/liste_intervenants-68eefa79eb1994b59f4523a4639a76d1-9b14a.png 163w,\n/static/liste_intervenants-68eefa79eb1994b59f4523a4639a76d1-94962.png 325w,\n/static/liste_intervenants-68eefa79eb1994b59f4523a4639a76d1-10273.png 650w,\n/static/liste_intervenants-68eefa79eb1994b59f4523a4639a76d1-2fc6f.png 975w,\n/static/liste_intervenants-68eefa79eb1994b59f4523a4639a76d1-a8a2c.png 1300w,\n/static/liste_intervenants-68eefa79eb1994b59f4523a4639a76d1-6cdbf.png 1329w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<br>\n<p>Jeyser est bien évidemment configurable. Paramètrez vos postes et les filières de votre école depuis l\'espace d\'administration.</p>\n<br>\n\n  <a class="gatsby-resp-image-link" href="/static/postes_filieres-894a33e748d4d207928fc6416b4b339d-ee06c.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 40.81632653061224%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Parametrez vos postes et fili&#xE8;res" title="" src="/static/postes_filieres-894a33e748d4d207928fc6416b4b339d-10273.png" srcset="/static/postes_filieres-894a33e748d4d207928fc6416b4b339d-9b14a.png 163w,\n/static/postes_filieres-894a33e748d4d207928fc6416b4b339d-94962.png 325w,\n/static/postes_filieres-894a33e748d4d207928fc6416b4b339d-10273.png 650w,\n/static/postes_filieres-894a33e748d4d207928fc6416b4b339d-ee06c.png 735w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<br>\n<p><strong>Astuce :</strong> Pour vous éviter toute erreur, Jeyser interdit aux membres qui n\'ont pas le poste de président de signer un document d\'une étude. Créez et affectez un poste <em>Président par procuration</em>  si vous avez besoin d\'ajouter un membre à la liste des signataires autorisés.</p>\n<p><strong>Astuce 2:</strong> Les membres de n\'importe quel poste commencant par "president" pourront être affichés dans la liste des signataires pour la junior.</p>'},navDoc:{edges:[{node:{title:"Installation",path:"install",items:[{id:"environment",title:"Environment",anchors:null},{id:"index",title:"Install Jeyser in minutes",anchors:null},{id:"update",title:"Update Jeyser",anchors:null},{id:"annexes",title:"Annexes",anchors:[{id:"help-for-manual-installation",title:"Help for manual installation"},{id:"ssh-key-connection",title:"SSH Key Connection"}]}]}},{node:{title:"Features",path:"features-fr",items:[{id:"gestion-associative",title:"Gestion associative",anchors:null},{id:"suivi-projet",title:"Suivi de projet",anchors:null},{id:"prospection",title:"Prospection",anchors:null},{id:"rh",title:"Relations humaines",anchors:null},{id:"tresorerie",title:"Trésorerie",anchors:null},{id:"formations",title:"Formations",anchors:null},{id:"indicateurs",title:"Indicateurs",anchors:null},{id:"documents-types",title:"Documents types",anchors:null},{id:"documents-types-faq",title:"FAQ Documents types",anchors:null},{id:"administration",title:"Administration",anchors:null},{id:"gdpr",title:"Règlement général sur la protection des données",anchors:null}]}},{node:{title:"User guides",path:"user-guides",items:[{id:"introduction-to-jeyser-1",title:"Introduction to Jeyser",anchors:null}]}},{node:{title:"Development",path:"dev",items:[{id:"faq",title:"FAQ",anchors:null},{id:"docker-architecture",title:"Architecture Docker",anchors:null},{id:"about",title:"About",anchors:null},{id:"demo-data",title:"Demo data",anchors:null},{id:"contributing",title:"Contributing",anchors:null}]}}]}},pathContext:{path:"docs/features-fr/gestion-associative",current:{path:"docs/features-fr/gestion-associative",title:"Features - Gestion associative"},prev:{path:"docs/install/annexes",title:"Installation - Annexes"},next:{path:"docs/features-fr/suivi-projet",title:"Suivi de projet",rootPath:"Features"}}}}});
